    - keyword: TABLE
    - table_reference:
      - naked_identifier: foo
    - keyword: PARTITION
    - bracketed:
      - start_bracket: (
      - column_reference:
        - naked_identifier: a
      - comparison_operator:
        - raw_comparison_operator: =
      - quoted_literal: '''test_foo'''
      - comma: ','
      - column_reference:
        - naked_identifier: b
      - end_bracket: )
    - keyword: IF
    - keyword: NOT
    - keyword: EXISTS
    - select_statement:
      - select_clause:
        - keyword: SELECT
