          - alias_expression:
            - alias_operator:
              - keyword: AS
            - naked_identifier: b
      - from_clause:
        - keyword: FROM
        - from_expression:
          - from_expression_element:
            - table_expression:
              - table_reference:
                - naked_identifier: bar
- statement_terminator: ;
